import React from 'react'

function AddCard() {
  return (
    <div style={{padding:'10px',
                 margin:'10px',
                 backgroundColor:'#d3d4d5',
                 borderRadius:'5px'}}>
      <img src="static/plus.svg" alt="" style={{width:'200px'}}/>
    </div>
  )
}

export default AddCard
